      <Row justify="center" align="middle" >
        <Col span={10}>
            <Row >
            <img style={{borderRadius: 10, boxShadow: '2px 2px 2px 0'}} src={`./mill-eye-icon.png`}/>
          <h1>WellCome to Yuco</h1>
          <small>New Yugioh community...</small>
            </Row>

        </Col>
        <Col span={10}>

          <Card style={{margin: 10}} title={<h1>REGISTER ACCOUNT</h1>}>
            <div>tets</div>
          </Card>
        </Col>
      </Row>
    </Layout>
  );
};
export default Register;
